import About from "./About";
import Services from "./Services";
import Product from "./Product";
import Offer from "./Offer";
import Team from "./Team";
import Blog from "./Blog";
function Home(){
    return(
        <>
            <About/>
            <Services/>
            <Product/>
            <Offer/>
            <Team/>
            <Blog/>
        </>
    );
}
export default Home;
